import {nth} from '@iterable-iterator/select';

import _sequence from './_sequence.js';

const _count = (init, k) => nth(_sequence(init), k);
export default _count;

import {list} from '@iterable-iterator/list';
import {map} from '@iterable-iterator/map';

export default function* _enumerate(elements, n = elements.length) {
	if (n === 0) yield [];
	else {
		const last = elements[n - 1];
		for (const partition of _enumerate(elements, n - 1)) {
			yield partition.concat([[last]]);
			for (const part of partition) {
				yield list(map((p) => (p === part ? p.concat([last]) : p), partition));
			}
		}
	}
}

export default function* _sequence(init) {
	yield init;
	const a = [init];
	while (true) {
		const n = a.length;
		let current = a[n - 1];
		yield current;
		for (let i = 0; i < n; ++i) {
			const next = current + a[i];
			a[i] = current;
			current = next;
		}

		a.push(current);
	}
}

import {list} from '@iterable-iterator/list';

import _enumerate from './_enumerate.js';

const enumerate = (elements) => _enumerate(list(elements));
export default enumerate;

